    render() {
        let {image, title, channel} = this.props;


    return (
        <div>
            <img className="app__aside-image"src="" alt="">
                {image}
            </img>
            <h4 className="app__aside-title">
                {title}
            </h4>
            <p className="app__aside-chanel">
                {channel}
            </p>
        </div>
    );
  }

}

export default AsideCard;
